INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(159211,"The Haunting of Helena","After a divorce, Sophia moves to the south of Italy with her daughter, Helena. Their new home, an apartment within an austere building of the fascist age, is a chance for them to start a new life. But inside an old storage room hides a mysterious closet and a buried secret. After the loss of Helena’s first baby tooth, a chilling obsession begins and an apparition haunts her sleep...",865.463,"2013-01-14","/iB8rf8FYHGlrbmLybCo6Mpg8hNt.jpg",98, 5.2,"0", 87, "She's coming for her.");
