INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(520763,"A Quiet Place Part II","Following the events at home, the Abbott family now face the terrors of the outside world. Forced to venture into the unknown, they realize that the creatures that hunt by sound are not the only threats that lurk beyond the sand path.",5503.546,"2021-05-21","/4q2hz2m8hubgvijz8Ez0T2Os2Yv.jpg",605, 7.6,"224400713", 97, "Silence is not enough.");
INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(520946,"100% Wolf","Freddy Lupin, heir to a proud family line of werewolves, is in for a shock when on his 14th birthday his first 'warfing' goes awry, turning him into a ferocious poodle. The pack elders give Freddy until the next moonrise to prove he has the heart of a wolf, or risk being cast out forever. With the help of an unlikely ally in a streetwise stray named Batty, Freddy must prove he's 100% Wolf.",334.347,"2020-06-26","/2VrvxK4yxNCU6KVgo5TADJeBEQu.jpg",160, 5.8,"4608579", 96, "Every pack needs a leader!");
INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(522406,"Flashback","Frederick Fitzell is living his best life—until he starts having horrific visions of Cindy, a girl who vanished in high school. After reaching out to old friends with whom he used to take a mystery drug called Mercury, Fredrick realizes the only way to stop the visions lies deep within his own memories, so he embarks on a terrifying mental odyssey to learn the truth.",860.493,"2021-06-03","/prffYgzc7xYWXBiFoFfsgzgrNfj.jpg",76, 7,"26747", 97, "In the blink of an eye your life can turn upside down");
