INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(592350,"My Hero Academia: Heroes Rising","Class 1-A visits Nabu Island where they finally get to do some real hero work. The place is so peaceful that it's more like a vacation … until they're attacked by a villain with an unfathomable Quirk! His power is eerily familiar, and it looks like Shigaraki had a hand in the plan. But with All Might retired and citizens' lives on the line, there's no time for questions. Deku and his friends are the next generation of heroes, and they're the island's only hope.",416.089,"2019-12-20","/zGVbrulkupqpbwgiNedkJPyQum4.jpg",742, 8.5,"29900850", 104, "");
INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(592656,"Brothers by Blood","Peter and Michael, raised on the streets of Philadelphia, are the children of Irish mob members, forever linked by the crimes of their fathers. 30 years later, Michael now runs the criminal organization and lusts for more power, his dangerous antics frequently held in check by his cautious cousin Peter. Haunted by the death of his sister, whose passing destroyed both his parents, Peter is caught between the dreams of childhood and the realities of his life as an enforcer. His only reprieve is a local boxing gym, a sanctuary that is quickly threatened as Michael’s desire for control escalates.",230.559,"2021-01-22","/2RKGUCbo2R6IDsufxApL6nRFL4j.jpg",60, 6,"0", 105, "Loyalty has a price.");
INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(596247,"Pacto de Fuga","During the last years of Pinochet's military regime,  a group of militants from the "Manuel Rodríguez Patriotic Front" plan a prison break of political prisoners, through a tunnel that will take them 18 months to dig.",238.091,"2020-01-23","/qDFfu73R8uO94ydFtdxEdSfTlg6.jpg",56, 7.8,"0", 138, "Based on the most daring prison escape of all time.");
INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(597890,"Voyagers","With the future of the human race at stake, a group of young men and women -- bred for intelligence and obedience -- embark on an expedition to colonize a distant planet. When they uncover disturbing secrets about the mission, they defy their training and begin to explore their most primitive natures. As life on the ship descends into chaos, they soon become consumed by fear, lust and an insatiable hunger for power.",233.391,"2021-04-08","/gn2vCmWO7jQBBto9SYuBHYZARaU.jpg",116, 6.6,"0", 108, "What does it feel like?");
INSERT INTO Movies(id, title, overview, popularity, releaseDate, posterPath, voteCount, voteAvg, revenue, runtime, tagline) VALUES(598896,"Land","Edee, in the aftermath of an unfathomable event, finds herself unable to stay connected to the world she once knew and in the face of that uncertainty, retreats to the magnificent, but unforgiving, wilds of the Rockies. After a local hunter brings her back from the brink of death, she must find a way to live again.",170.335,"2021-02-12","/6pYhDPzYPGKvDYpxdf0IUE3RDAS.jpg",42, 7.4,"2.37519e+06", 89, "A story of humanity, in the face of uncertainty");
