INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(121,"Doctor Who","The adventures of a Time Lord—a time-travelling humanoid alien known as the Doctor—who explores the universe in his TARDIS, a sentient time-travelling space ship. Its exterior appears as a blue British police box, which was a common sight in Britain in 1963 when the series first aired. Along with a succession of companions, the Doctor faces a variety of foes while working to save civilisations, help ordinary people, and right wrongs.",146.425,26,694,"/qgtHj2YyIMwGCCq2QQfWUvkqAUx.jpg",352, 7.9,"1963-11-23", "1989-12-06", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(456,"The Simpsons","Set in Springfield, the average American town, the show focuses on the antics and everyday adventures of the Simpson family; Homer, Marge, Bart, Lisa and Maggie, as well as a virtual cast of thousands. Since the beginning, the series has been a pop culture icon, attracting hundreds of celebrities to guest star. The show has also made name for itself in its fearless satirical take on politics, media and American life in general.",403.825,33,707,"/zLudbPueg8CxGhMS2tyDh3p0TdK.jpg",6704, 7.9,"1989-12-17", "2021-05-23", "On your marks, get set, d'oh!");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1396,"Breaking Bad","When Walter White, a New Mexico chemistry teacher, is diagnosed with Stage III cancer and given a prognosis of only two years left to live. He becomes filled with a sense of fearlessness and an unrelenting desire to secure his family's financial future at any cost as he enters the dangerous world of drugs and crime.",257.018,5,62,"/ggFHVNu6YYI5L9pCfOacjizRGt.jpg",7178, 8.7,"2008-01-20", "2013-09-29", "Remember my name");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1399,"Game of Thrones","Seven noble families fight for control of the mythical land of Westeros. Friction between the houses leads to full-scale war. All while a very ancient evil awakens in the farthest north. Amidst the war, a neglected military order of misfits, the Night's Watch, is all that stands between the realms of men and icy horrors beyond.",499.131,8,73,"/u3bZgnGQ9T01sWNhyveQz0wH0Hl.jpg",14875, 8.4,"2011-04-17", "2019-05-19", "Winter Is Coming");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1402,"The Walking Dead","Sheriff's deputy Rick Grimes awakens from a coma to find a post-apocalyptic world dominated by flesh-eating zombies. He sets out to find his family and encounters many other survivors along the way.",423.022,11,161,"/rqeYMLryjcawh2JeRpCVUDXYM5b.jpg",11035, 8.1,"2010-10-31", "2021-04-04", "Fight the dead. Fear the living.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1408,"House","Dr. Gregory House, a drug-addicted, unconventional, misanthropic medical genius, leads a team of diagnosticians at the fictional Princeton–Plainsboro Teaching Hospital in New Jersey.",275.105,8,177,"/lkvhReTBZ2Ksl0Dl5Oplsf6UYkF.jpg",3669, 8.6,"2004-11-16", "2012-05-21", "Genius has side effects.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1412,"Arrow","Spoiled billionaire playboy Oliver Queen is missing and presumed dead when his yacht is lost at sea. He returns five years later a changed man, determined to clean up the city as a hooded vigilante armed with a bow.",195.773,8,170,"/gKG5QGz5Ngf8fgWpBsWtlg5L2SF.jpg",4594, 6.7,"2012-10-10", "2020-01-28", "Heroes fall. Legends rise.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1413,"American Horror Story","An anthology horror drama series centering on different characters and locations, including a house with a murderous past, an asylum, a witch coven, a freak show, a hotel, a farmhouse in Roanoke and a cult.",214.58,10,104,"/8NMACR0OE5bwC27rE15f8ManNBO.jpg",3675, 8.1,"2011-10-05", "2019-11-13", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1416,"Grey's Anatomy","Follows the personal and professional lives of a group of doctors at Seattle’s Grey Sloan Memorial Hospital.",743.233,17,379,"/clnyhPqj1SNgpAdeSS6a6fwE6Bo.jpg",6319, 8.2,"2005-03-27", "2021-06-03", "The life you save may be your own.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1418,"The Big Bang Theory","The sitcom is centered on five characters living in Pasadena, California: roommates Leonard Hofstadter and Sheldon Cooper; Penny, a waitress and aspiring actress who lives across the hall; and Leonard and Sheldon's equally geeky and socially awkward friends and co-workers, mechanical engineer Howard Wolowitz and astrophysicist Raj Koothrappali. The geekiness and intellect of the four guys is contrasted for comic effect with Penny's social skills and common sense.",187.012,12,279,"/ooBGRQBdbGzBxAVfExiO8r7kloA.jpg",7305, 7.7,"2007-09-24", "2019-05-16", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1419,"Castle","After a serial killer imitates the plots of his novels, successful mystery novelist Richard "Rick" Castle receives permission from the Mayor of New York City to tag along with an NYPD homicide investigation team for research purposes.",155.978,8,173,"/diXBeMzvfJb2iJg3G0kCUaMCzEc.jpg",1120, 8,"2009-03-09", "2016-05-16", "A whole new chapter in crime solving.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1431,"CSI: Crime Scene Investigation","A Las Vegas team of forensic investigators are trained to solve criminal cases by scouring the crime scene, collecting irrefutable evidence and finding the missing pieces that solve the mystery.",211.904,15,335,"/t6hnMaWMuX2brNL6Dq52dDLxZMt.jpg",683, 7.6,"2000-10-06", "2015-02-15", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1433,"American Dad!","The series focuses on an eccentric motley crew that is the Smith family and their three housemates: Father, husband, and breadwinner Stan Smith; his better half housewife, Francine Smith; their college-aged daughter, Hayley Smith; and their high-school-aged son, Steve Smith. Outside of the Smith family, there are three additional main characters, including Hayley's boyfriend turned husband, Jeff Fischer; the family's man-in-a-goldfish-body pet, Klaus; and most notably the family's zany alien, Roger, who is "full of masquerades, brazenness, and shocking antics."",216.503,18,311,"/aC1q422YhQR7k82GB8gW4KoD91p.jpg",1314, 6.8,"2005-02-06", "2021-06-21", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1434,"Family Guy","Sick, twisted, politically incorrect and Freakin' Sweet animated series featuring the adventures of the dysfunctional Griffin family. Bumbling Peter and long-suffering Lois have three kids. Stewie (a brilliant but sadistic baby bent on killing his mother and taking over the world), Meg (the oldest, and is the most unpopular girl in town) and Chris (the middle kid, he's not very bright but has a passion for movies). The final member of the family is Brian - a talking dog and much more than a pet, he keeps Stewie in check whilst sipping Martinis and sorting through his own life issues.",236.913,20,369,"/eWWCRjBfLyePh2tfZdvNcIvKSJe.jpg",2820, 7,"1999-01-31", "2021-05-16", "Parental Discretion Advised, that's how you know it's good");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1622,"Supernatural","When they were boys, Sam and Dean Winchester lost their mother to a mysterious and demonic supernatural force. Subsequently, their father raised them to be soldiers. He taught them about the paranormal evil that lives in the dark corners and on the back roads of America ... and he taught them how to kill it. Now, the Winchester brothers crisscross the country in their '67 Chevy Impala, battling every kind of supernatural threat they encounter along the way. ",250.711,15,327,"/KoYWXbnYuS3b0GyQPkbuexlVK9.jpg",5209, 8.2,"2005-09-13", "2020-11-19", "Between darkness and deliverance");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1668,"Friends","The misadventures of a group of friends as they navigate the pitfalls of work, life and love in Manhattan.",234.265,10,236,"/f496cm9enuEsZkSPzCwnTESEK5s.jpg",4712, 8.4,"1994-09-22", "2004-05-06", "I'll be there for you");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(1911,"Bones","Dr. Temperance Brennan and her colleagues at the Jeffersonian's Medico-Legal Lab assist Special Agent Seeley Booth with murder investigations when the remains are so badly decomposed, burned or destroyed that the standard identification methods are useless.",229.977,12,246,"/eyTu5c8LniVciRZIOSHTvvkkgJa.jpg",2042, 8.3,"2005-09-13", "2017-03-28", "Every body has secrets.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(2004,"Malcolm in the Middle","A gifted young teen tries to survive life with his dimwitted, dysfunctional family.",172.086,7,151,"/uwslHj6nEyPX5IbNXhuEeI0PTth.jpg",2317, 8.4,"2000-01-09", "2006-05-14", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(2190,"South Park","Follows the misadventures of four irreverent grade-schoolers in the quiet, dysfunctional town of South Park, Colorado.",188.962,24,309,"/iiCY2QIGSnmtVkIdjkKAfwDs0KF.jpg",2432, 8.2,"1997-08-13", "2021-03-10", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(2224,"The Daily Show with Trevor Noah","Trevor Noah and The World's Fakest News Team tackle the biggest stories in news, politics and pop culture.",181.593,26,3593,"/nz5fAg1OomLZ7fxiM4RnLbJxppc.jpg",340, 6.4,"1996-07-22", "2021-06-17", "When news breaks we fix it.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(2734,"Law & Order: Special Victims Unit","In the criminal justice system, sexually-based offenses are considered especially heinous. In New York City, the dedicated detectives who investigate these vicious felonies are members of an elite squad known as the Special Victims Unit. These are their stories.",366.162,22,494,"/jDCgWVlejIo8sQYxw3Yf1cVQUIL.jpg",2485, 7.8,"1999-09-20", "2021-06-03", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(4057,"Criminal Minds","An elite team of FBI profilers analyze the country's most twisted criminal minds, anticipating their next moves before they strike again. The Behavioral Analysis Unit's most experienced agent is David Rossi, a founding member of the BAU who returns to help the team solve new cases.",199.329,15,324,"/7TCwgX7oQKxcWYEhSPRmaHe6ULN.jpg",2394, 8.3,"2005-09-22", "2020-02-19", "To catch a criminal, you have to think like one.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(4604,"Smallville","The origins of the world’s greatest hero–from Krypton refugee Kal-el’s arrival on Earth through his tumultuous teen years to Clark Kent’s final steps toward embracing his destiny as the Man of Steel.",291.156,10,216,"/pUhJGETy2sec4vEkiqJ9eGeIywc.jpg",2532, 8.2,"2001-10-16", "2011-05-13", "Every story has a beginning.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(4614,"NCIS","From murder and espionage to terrorism and stolen submarines, a team of special agents investigates any crime that has a shred of evidence connected to Navy and Marine Corps personnel, regardless of rank or position.",197.744,18,414,"/fi8EvaWtL5CvoielOjjVvTr7ux3.jpg",1511, 7.5,"2003-09-23", "2021-05-25", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(4686,"Ben 10","When 10-year-old Ben Tennyson discovers a mysterious device, he gains the power to change into ten different alien heroes, each with uniquely awesome powers. With such abilities at his disposal, Ben realizes a greater responsibility to help others and stop evildoers, but that doesn't mean he's above a little superpowered mischief now and then.",182.426,4,52,"/pT0NlYVIkwM2zAw9oUkePwrOlxW.jpg",981, 8.1,"2005-12-27", "2008-04-15", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(5371,"iCarly","Watch Carly, Sam, and Freddie, as they try to balance their everyday 8th grade lives with their newfound fame managing and starring in the most awesome show on the web.",324.535,6,107,"/kP8Z51s9D8tiGnoRbL88db0e2jv.jpg",969, 8,"2007-09-08", "2012-11-24", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(5920,"The Mentalist","Patrick Jane, a former celebrity psychic medium, uses his razor sharp skills of observation and expertise at "reading" people to solve serious crimes with the California Bureau of Investigation.",227.732,7,151,"/acYXu4KaDj1NIkMgObnhe4C4a0T.jpg",2208, 8.4,"2008-09-23", "2015-02-18", "Let the mind games begin.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(9027,"Rebelde Way","Rebelde Way is a Martín Fierro Award—nominated Argentine soap opera created and produced by Cris Morena. It originally aired from 26 May 2002 to 18 December 2003. The series was broadcast in many countries worldwide, including Peru, Germany, Israel, Spain and Uruguay, achieving widespread success. In addition, numerous remakes of Rebelde Way have been made, most notably Rebelde by Mexican Televisa. In 2009, Jennifer Lopez bought the rights for an U.S. adaptation.</ref>
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(11250,"Pasión de gavilanes","Pasión de Gavilanes is a Colombian telenovela that ran for 188 episodes, from 2003 to 2004. Written by Julio Jiménez, it was produced by RTI Colombia in conjunction with the Telemundo network and with the participation of Caracol TV company. In Colombia, it was broadcast by Caracol TV. It is based on the 1994 telenovela Las aguas mansas, also written by Jiménez and produced by RTI, broadcast on Canal Uno.",188.651,1,188,"/2vNyh5bkGn4cmeXZQADOa7Zba8d.jpg",1451, 7.7,"2003-10-21", "2004-12-02", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(12637,"Rebelde","The series is set at the Elite Way School, a prestigious private boarding high school in Mexico City with a major plot line revolving around a group of students forming a pop band. Additional subplots involve the school's faculty and the students' parents. One trademark of the show is the random use of English words and phrases, often used by fresa characters.",180.96,3,440,"/iehrrb9CmYCiV1hXp5pdGQQmGNe.jpg",3951, 8.5,"2004-10-04", "2006-06-09", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(12926,"Teresa","Teresa Chavez is a young woman with an obsession for money and ambition. Despite her beauty and the fact that she was raised in the bosom of a loving family, she is resentful; her one desire is to leave her humble but poor neighbourhood.",192.033,1,151,"/17QQBTahkRE23bxJ4PmQ7tjMjyX.jpg",1282, 7.5,"2010-08-02", "2011-02-27", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(12971,"Dragon Ball Z","After learning that he is from another planet, a warrior named Goku and his friends are prompted to defend it from an onslaught of extraterrestrial enemies.",279.259,9,291,"/6VKOfL6ihwTiB5Vibq6QTfzhxA6.jpg",2430, 8.2,"1989-04-26", "1996-01-31", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(13354,"Question Time","This topical debate series based on Any Questions? typically features politicians from at least the three major political parties as well as other public figures who answer pre-selected questions put to them by a carefully selected audience.",174.127,43,1495,"/nLGgjwQNnCKuDdJMDmp02pxB0u9.jpg",6, 5.8,"1979-09-25", "2021-05-27", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(15260,"Adventure Time","Hook up with Finn and Jake as they travel the Land of Ooo searching for adventure. But remember, adventure isn’t always easy. Sometimes you’ve got to battle fire gnomes that torture old ladies, save a smelly hot dog princess from the Ice King, and thaw out a bunch of frozen businessmen. What the cabbage?!",212.8,10,279,"/qk3eQ8jW4opJ48gFWYUXWaMT4l.jpg",1588, 8.3,"2010-04-05", "2018-09-03", "They’re not righteous, they’re wrongteous!");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(16286,"Yo soy Betty, la fea","Yo soy Betty, la fea is a telenovela filmed in Colombia, written by Fernando Gaitán and produced from October 25, 1999 to May 8, 2001 by the Colombian network RCN. More than a dozen versions of the telenovela have been made in other countries. In the United States, both the comedy-drama hit Ugly Betty and Televisa program La Fea Más Bella are based on the Colombian soap opera.
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(18165,"The Vampire Diaries","The story of two vampire brothers obsessed with the same girl, who bears a striking resemblance to the beautiful but ruthless vampire they knew and loved in 1864.",376.738,8,171,"/kLEha9zVVv8acGFKTX4gjvSR2Q0.jpg",6113, 8.3,"2009-09-10", "2017-03-10", "You remember your first kiss forever... and ever.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(31132,"Regular Show","Two bored groundskeepers, Mordecai (a six-foot-tall blue jay) and Rigby (a hyperactive raccoon) are best friends who spend their days trying to entertain themselves by any means necessary, much to the displeasure of their boss. Their everyday pursuits often lead to things spiraling out of control and into the surreal.",221.509,8,258,"/88dAGv0ywrLJKCynkH226dBwe0i.jpg",1141, 8.8,"2010-09-06", "2017-01-16", "It's anything but");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(31586,"La Reina del Sur","After years of blood, sweat and tears, a woman of humble origin ends up becoming a drug trafficking legend, with all that that means...",171.857,2,123,"/p11t8ckTC6EiuVw5FGFKdc2Z7GH.jpg",884, 7.7,"2011-02-28", "2019-07-29", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(31910,"Naruto Shippūden","Naruto Shippuuden is the continuation of the original animated TV series Naruto.The story revolves around an older and slightly more matured Uzumaki Naruto and his quest to save his friend Uchiha Sasuke from the grips of the snake-like Shinobi, Orochimaru. After 2 and a half years Naruto finally returns to his village of Konoha, and sets about putting his ambitions to work, though it will not be easy, as He has amassed a few (more dangerous) enemies, in the likes of the shinobi organization; Akatsuki.",255.793,20,500,"/zAYRe2bJxpWTVrwwmBc00VFkAf4.jpg",5583, 8.6,"2007-02-15", "2017-03-23", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(32415,"Conan","A late night television talk show hosted by  Conan O'Brien.",160.462,11,1508,"/oQxrvUhP3ycwnlxIrIMQ9Z3kleq.jpg",136, 7.2,"2010-11-08", "2021-06-17", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(32692,"Blue Bloods","A drama about a multi-generational family of cops dedicated to New York City law enforcement. Frank Reagan is the New York Police Commissioner and heads both the police force and the Reagan brood. He runs his department as diplomatically as he runs his family, even when dealing with the politics that plagued his unapologetically bold father, Henry, during his stint as Chief.",142.015,11,234,"/5zbiQLACiHk96PXsGpvC5XPNLkm.jpg",421, 7.5,"2010-09-24", "2021-05-14", "Honor. Justice. Family. It’s in their blood.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(32798,"Hawaii Five-0","Steve McGarrett returns home to Oahu, in order to find his father's killer. The governor offers him the chance to run his own task force (Five-0). Steve's team is joined by Chin Ho Kelly, Danny "Danno" Williams, and Kono Kalakaua.",184.5,10,240,"/sIdCKlmM2nU4akIvFQaAIiU8YES.jpg",1045, 7.6,"2010-09-20", "2020-04-03", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(34524,"Teen Wolf","Scott McCall, a high school student living in the town of Beacon Hills has his life drastically changed when he's bitten by a werewolf, becoming one himself. He must henceforth learn to balance his problematic new identity with his day-to-day teenage life. The following characters are instrumental to his struggle: Stiles, his best friend; Allison, his love interest who comes from a family of werewolf hunters; and Derek, a mysterious werewolf with a dark past. Throughout the series, he strives to keep his loved ones safe while maintaining normal relationships with them.",319.665,6,100,"/vY2vfAskJTiWsQSv6bdbNCQhPLm.jpg",2533, 8.6,"2011-06-05", "2017-09-24", "Watch your pack.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(37680,"Suits","While running from a drug deal gone bad, Mike Ross, a brilliant young college-dropout, slips into a job interview with one of New York City's best legal closers, Harvey Specter. Tired of cookie-cutter law school grads, Harvey takes a gamble by hiring Mike on the spot after he recognizes his raw talent and photographic memory.",229.771,9,134,"/vQiryp6LioFxQThywxbC6TuoDjy.jpg",2203, 8,"2011-06-23", "2019-09-25", "Nothing is ever black and white");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(39351,"Grimm","After Portland homicide detective Nick Burkhardt discovers he's descended from an elite line of criminal profilers known as "Grimms," he increasingly finds his responsibilities as a detective at odds with his new responsibilities as a Grimm.",204.003,6,122,"/iOptnt1QHi6bIHmOq6adnZTV0bU.jpg",2009, 8.2,"2011-10-28", "2017-03-31", "Mortal. Danger.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(43348,"Pablo Escobar The Drug Lord","Pablo Escobar: El Patrón del Mal is a 2012 Colombian television series produced and broadcast on Caracol TV, about the life of Pablo Escobar. It is only available in Spanish. There is a version available with English subtitles.  It is also available on Netflix in multiple languages.
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(44006,"Chicago Fire","An edge-of-your-seat view into the lives of everyday heroes committed to one of America's noblest professions. For the firefighters, rescue squad and paramedics of Chicago Firehouse 51, no occupation is more stressful or dangerous, yet so rewarding and exhilarating. These courageous men and women are among the elite who forge headfirst into danger when everyone else is running the other way and whose actions make the difference between life and death.",223.252,9,195,"/6AccYL0eb7uzHn98IKaNjvJbyuA.jpg",1388, 8.4,"2012-10-10", "2021-05-26", "Feel the heat.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(44217,"Vikings","The adventures of Ragnar Lothbrok, the greatest hero of his age. The series tells the sagas of Ragnar's band of Viking brothers and his family, as he rises to become King of the Viking tribes. As well as being a fearless warrior, Ragnar embodies the Norse traditions of devotion to the gods. Legend has it that he was a direct descendant of Odin, the god of war and warriors.",318.678,6,89,"/bQLrHIRNEkE3PdIWQrZHynQZazu.jpg",4581, 8,"2013-03-03", "2020-12-30", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(44953,"The Lord of the Skies","Set in the 1990s, these are the life and times of Amado Carrillo Fuentes, a man who became the head of the Juárez cartel. Nicknamed “El Señor de los Cielos” (Lord of the Skies) because of the large fleet of airplanes he used to transport drugs, he was also known for washing more than $200 million through Colombia to finance his huge fleet. He is described as the most powerful drug trafficker of his time.",280.513,7,611,"/Ag7VUdnrRz5Qpq3Yn3E5OCvFnu0.jpg",1307, 7.7,"2013-04-15", "2019-12-31", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(46260,"Naruto","In another world, ninja are the ultimate power, and in the Village Hidden in the Leaves live the stealthiest ninja in the land. Twelve years earlier, the fearsome Nine-Tailed Fox terrorized the village and claimed many lives before it was subdued and its spirit sealed within the body of a baby boy. That boy, Naruto Uzumaki, has grown up to become a ninja-in-training who's more interested in pranks than in studying ninjutsu.. but Naruto is determined to become the greatest ninja ever!",311.922,4,220,"/vauCEnR7CiyBDzRCeElKkCaXIYu.jpg",3716, 8.4,"2002-10-03", "2007-02-08", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(46639,"American Gods","An ex-con becomes the traveling partner of a conman who turns out to be one of the older gods trying to recruit troops to battle the upstart deities. Based on Neil Gaiman's fantasy novel.",154.37,3,26,"/3KCAZaKHmoMIN9dHutqaMtubQqD.jpg",1045, 7.1,"2017-04-30", "2021-03-21", "Believe.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(46896,"The Originals","A spin-off from The Vampire Diaries and set in New Orleans, The Originals centers on the Mikaelson siblings, otherwise known as the world's original vampires: Klaus, Elijah, and Rebekah. Now Klaus must take down his protégé, Marcel, who is now in charge of New Orleans, in order to re-take his city, as he originally built New Orleans. Klaus departed from the city after being chased down by his father Mikael, while it was being constructed and Marcel took charge. As Klaus has returned after many years, his ego has provoked him to become the king of the city. "Every King needs an heir" says Klaus, accepting the unborn child. The child is a first to be born to a hybrid and a werewolf.",183.618,5,92,"/2llbXc2BOkLkBGgcNJCRbrWedUO.jpg",2241, 8.6,"2013-10-03", "2018-08-01", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(46952,"The Blacklist","Raymond "Red" Reddington, one of the FBI's most wanted fugitives, surrenders in person at FBI Headquarters in Washington, D.C. He claims that he and the FBI have the same interests: bringing down dangerous criminals and terrorists. In the last two decades, he's made a list of criminals and terrorists that matter the most but the FBI cannot find because it does not know they exist. Reddington calls this "The Blacklist". Reddington will co-operate, but insists that he will speak only to Elizabeth Keen, a rookie FBI profiler.",254.75,8,174,"/htJzeRcYI2ewMm4PTrg98UMXShe.jpg",2021, 7.4,"2013-09-23", "2021-06-23", "Family. Business.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(48866,"The 100","100 years in the future, when the Earth has been abandoned due to radioactivity, the last surviving humans live on an ark orbiting the planet — but the ark won't last forever. So the repressive regime picks 100 expendable juvenile delinquents to send down to Earth to see if the planet is still habitable.",326.584,7,100,"/wcaDIAG1QdXQLRaj4vC1EFdBT2.jpg",6245, 7.9,"2014-03-19", "2020-09-30", "Survival isn't who you are. It's who you become.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(57243,"Doctor Who","The Doctor is a Time Lord: a 900 year old alien with 2 hearts, part of a gifted civilization who mastered time travel. The Doctor saves planets for a living—more of a hobby actually, and the Doctor's very, very good at it.",191.193,13,148,"/cDDb7WA2i7cENhkEEjXEDrXGyNL.jpg",2068, 7.2,"2005-03-26", "2020-03-01", "Space. For all.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(58142,"Paraíso","The story revolves around a group of teenagers investigating three missing girls in 1992, one of whom is the sister of one of the searchers. Working parallel to the official police investigation, the group will follow their own instinct to uncover things authorities may have missed.",286.821,1,8,"/6KkM6gLFloyybv6qFZs6t5taWws.jpg",0, 0,"2021-06-04", "2021-06-25", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(58841,"Chicago P.D.","A riveting police drama about the men and women of the Chicago Police Department's District 21 who put it all on the line to serve and protect their community. District 21 is made up of two distinctly different groups: the uniformed cops who patrol the beat and go head-to-head with the city's street crimes and the Intelligence Unit that combats the city's major offenses - organized crime, drug trafficking, high profile murders and beyond.",217.748,8,164,"/OlPR1kctwXzSUJQkZINDDhNlHV.jpg",1500, 8.4,"2014-01-08", "2021-05-26", "Break the rules. Not the law.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(60574,"Peaky Blinders","A gangster family epic set in 1919 Birmingham, England and centered on a gang who sew razor blades in the peaks of their caps, and their fierce boss Tommy Shelby, who means to move up in the world.",309.472,5,30,"/6PX0r5TRRU5y0jZ70y1OtbLYmoD.jpg",2847, 8.6,"2013-09-12", "2019-09-22", "London's for the taking");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(60625,"Rick and Morty","Rick is a mentally-unbalanced but scientifically-gifted old man who has recently reconnected with his family. He spends most of his time involving his young grandson Morty in dangerous, outlandish adventures throughout space and alternate universes. Compounded with Morty's already unstable family life, these events cause Morty much distress at home and school.",968.583,5,51,"/8kOWDBK6XlPUzckuHDo3wwVRFwt.jpg",4558, 8.8,"2013-12-02", "2021-06-27", "Science makes sense, family doesn't.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(60735,"The Flash","After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only "meta-human" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won't be long before the world learns what Barry Allen has become...The Flash.",1071.493,8,152,"/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg",7922, 7.7,"2014-10-07", "2021-06-22", "The fastest man alive.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(60797,"Scorpion","Based on a true story, Scorpion is a high-octane drama about eccentric genius Walter O’Brien and his team of brilliant misfits who comprise the last line of defense against complex, high-tech threats of the modern age. As Homeland Security’s new think tank, O’Brien’s “Scorpion” team includes Toby Curtis, an expert behaviorist who can read anyone; Happy Quinn, a mechanical prodigy; and Sylvester Dodd, a statistics guru.",255.103,4,93,"/hzeirSF6bRjssDh5JFrm5WRwFLd.jpg",2450, 8.3,"2014-09-22", "2018-04-16", "This team is pure genius.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(61753,"Thor & Loki: Blood Brothers","Inspired by the acclaimed graphic novel from Robert Rodi and Esad Ribic, Marvel Knights Animation's "Thor & Loki: Blood Brothers" takes a powerful look inside the minds of Thor & Loki, brothers in the mythical land of Asgard and seemingly forever enemies. But just why does Loki hate his brother Thor? And could it be that this master of mischief isn’t really the villain he’s been branded? Loki's insatiable lust for power and his feud with Thor take on new meaning in this resonant epic.",209.022,1,4,"/tvd33sRfEEf4fBlyqxTI62wY9qF.jpg",4, 7.8,"2011-03-28", "2011-04-20", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(62286,"Fear the Walking Dead","What did the world look like as it was transforming into the horrifying apocalypse depicted in "The Walking Dead"? This spin-off set in Los Angeles, following new characters as they face the beginning of the end of the world, will answer that question.",400.488,6,85,"/4UjiPdFKJGJYdxwRs2Rzg7EmWqr.jpg",3666, 7.7,"2015-08-23", "2021-06-13", "Every decision is life or death.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(62643,"DC's Legends of Tomorrow","When heroes alone are not enough ... the world needs legends. Having seen the future, one he will desperately try to prevent from happening, time-traveling rogue Rip Hunter is tasked with assembling a disparate group of both heroes and villains to confront an unstoppable threat — one in which not only is the planet at stake, but all of time itself. Can this ragtag team defeat an immortal threat unlike anything they have ever known?",210.286,7,98,"/uzQpQGISbtxc047IOssFo5AiDwU.jpg",1623, 7.2,"2016-01-21", "2021-06-13", "Their time is now.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(62688,"Supergirl","Twenty-four-year-old Kara Zor-El, who was taken in by the Danvers family when she was 13 after being sent away from Krypton, must learn to embrace her powers after previously hiding them. The Danvers teach her to be careful with her powers, until she has to reveal them during an unexpected disaster, setting her on her journey of heroism.",227.789,6,118,"/zsaiq8ZclPuneuN7loLEbsh1ANJ.jpg",3133, 7.3,"2015-10-26", "2021-05-11", "A force against fear");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(62715,"Dragon Ball Super","With Majin Boo defeated half-a-year prior, peace returns to Earth, where Son Goku (now a radish farmer) and his friends now live peaceful lives. However, a new threat appears in the form of Beerus, the God of Destruction. Considered the most terrifying being in the entire universe, Beerus is eager to fight the legendary warrior seen in a prophecy foretold decades ago known as the Super Saiyan God. The series retells the events from the two Dragon Ball Z films, Battle of Gods and Resurrection 'F' before proceeding to an original story about the exploration of alternate universes.",182.052,1,131,"/kbhu0tIv5E1PbAw2YPjrhoQ7I1s.jpg",3057, 8.2,"2015-07-05", "2018-03-25", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(63174,"Lucifer","Bored and unhappy as the Lord of Hell, Lucifer Morningstar abandoned his throne and retired to Los Angeles, where he has teamed up with LAPD detective Chloe Decker to take down criminals. But the longer he's away from the underworld, the greater the threat that the worst of humanity could escape.",1137.901,6,93,"/4EYPN5mVIhKLfxGruy7Dy41dTVn.jpg",9403, 8.5,"2016-01-25", "2021-05-28", "It's good to be bad.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(64154,"Genial daneben","",121.44,14,470,"/ynYlT1WOxUzMKZKUMxwzBEu5lVa.jpg",2, 8.5,"2003-01-11", "2021-05-07", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(65334,"Miraculous: Tales of Ladybug & Cat Noir","Normal high school kids by day, protectors of Paris by night! Miraculous follows the heroic adventures of Marinette and Adrien as they transform into Ladybug and Cat Noir and set out to capture akumas, creatures responsible for turning the people of Paris into villains. But neither hero knows the other’s true identity – or that they’re classmates!",281.942,4,93,"/qxbW47zmgFyBVmZSIqD9NA1DEjT.jpg",2826, 7.9,"2015-10-19", "2021-06-06", "Time to de-evilize!");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(65555,"Endless Love","Two separate worlds lie on two sides of the road in a seaside town. Both too close and way too far from each other. What happens when two young people from these worlds fall in love?  Kemal is one of the three children of a moderate family that lives in one of the inner neighborhoods of the town. His hand to mouth world has pinned all hopes on him. The motive of this world is not high aims, it’s to make a living and survive. It’s Kemal’s last year in mine engineering. His dreams are restricted with the truth and he doesn’t believe in miracles. Especially in miracles like love.  Kemal is soon tested with his disbelief and Nihan hops into his monotonous life. After that day Kemal’s world turns upside down and he loses control.",191.399,2,74,"/n0ia3oDpfgS3VTx9ZJrwBHihS4a.jpg",368, 7.7,"2015-10-14", "2017-05-31", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(65820,"Van Helsing","Vanessa Helsing, the daughter of famous vampire hunter and Dracula nemesis Abraham Van Helsing is resurrected five years in the future to find out that vampires have taken over the world and that she possesses unique power over them. She is humanity’s last hope to lead an offensive to take back what has been lost.",313.98,5,65,"/r8ODGmfNbZQlNhiJl2xQENE2jsk.jpg",606, 7,"2016-09-23", "2021-06-25", "");
