INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(77169,"Cobra Kai","This Karate Kid sequel series picks up 30 years after the events of the 1984 All Valley Karate Tournament and finds Johnny Lawrence on the hunt for redemption by reopening the infamous Cobra Kai karate dojo. This reignites his old rivalry with the successful Daniel LaRusso, who has been working to maintain the balance in his life without mentor Mr. Miyagi.",316.256,4,30,"/4CkQvdUAtoLW3qkjWi7t1MTnW7R.jpg",3255, 8.1,"2018-05-02", "2021-01-01", "Cobra Kai never dies.");
