INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(79744,"The Rookie","Starting over isn’t easy, especially for small-town guy John Nolan who, after a life-altering incident, is pursuing his dream of being an LAPD officer. As the force’s oldest rookie, he’s met with skepticism from some higher-ups who see him as just a walking midlife crisis.",197.813,3,54,"/6hChiX0vIjWY4y2kz1WndHVMsDu.jpg",488, 8,"2018-10-16", "2021-05-16", "He’s got this.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(80020,"Super Dragon Ball Heroes","Trunks returns from the future to train with Goku and Vegeta. However, it disappears without warning. Then the mysterious Fu bursts in, telling them that Trunks has been imprisoned in the Prison Planet, a mysterious complex in an unknown place in the universes. The group seeks the dragon balls to free Trunks, but an endless battle awaits them! Will Goku and the others rescue Trunks and escape the Prison Planet?",308.664,4,35,"/jYeTfpxS3IzgqKkYCjmdCKwq8PW.jpg",2026, 7.5,"2018-07-01", "2021-06-20", "");
