INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(80350,"New Amsterdam","The new medical director breaks the rules to heal the system at America's oldest public hospital. Max Goodwin sets out to tear up the bureaucracy and provide exceptional care, but the doctors and staff are not so sure he can succeed. They've heard this before. Not taking "no" for an answer, Dr. Goodwin's instinctive response to problems large and small is four simple words: "How can I help?" He has to disrupt the status quo and prove he'll stop at nothing to breathe new life into this underfunded and underappreciated hospital, returning it to the glory that put it on the map.",150.417,3,54,"/wKTAz8fkoXJoHqPpi4ArAUGDtco.jpg",386, 8.4,"2018-09-25", "2021-05-18", "Break the rules. Heal the system.");
