INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(84958,"Loki","After stealing the Tesseract during the events of “Avengers: Endgame,” an alternate version of Loki is brought to the mysterious Time Variance Authority, a bureaucratic organization that exists outside of time and space and monitors the timeline. They give Loki a choice: face being erased from existence due to being a “time variant”or help fix the timeline and stop a greater threat.",5314.038,1,6,"/kEl2t3OhXc3Zb9FBh1AuYzRTgZp.jpg",4121, 8.1,"2021-06-09", "2021-06-23", "Loki's time has come.");
