INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(86430,"Your Honor","New Orleans judge Michael Desiato is forced to confront his own deepest convictions when his son is involved in a hit and run that embroils an organized crime family.",286.968,1,10,"/xWJZjIKPeEZhK3JRYKOe06yW6IU.jpg",768, 8.2,"2020-12-06", "2021-02-14", "How far would you go to save your child?");
