INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(93484,"Jupiter's Legacy","As the world's first generation of superheroes (who received their powers in the 1930s) become the revered elder guard in the present, their superpowered children struggle to live up to the legendary feats of their parents.",300.483,1,8,"/9yxep7oJdkj3Pla9TD9gKflRApY.jpg",342, 7.4,"2021-05-07", "2021-05-07", "No legacy lives forever.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(93693,"Are You Afraid of the Dark?","Each season of this horror anthology series follows a different group of kids, members of the Midnight Society, as they discover terrifying curses and creatures.",153.888,2,9,"/seCdnVx50nhHmDqaC6QEYM3jSG3.jpg",144, 7.5,"2019-10-11", "2021-03-19", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(93741,"Jurassic World: Camp Cretaceous","Six teens attending an adventure camp on the opposite side of Isla Nublar must band together to survive when dinosaurs wreak havoc on the island.",189.583,3,26,"/jWTDtbp2TnUGw1OJoDqq2O9IS0M.jpg",1228, 7.9,"2020-09-18", "2021-05-21", "Discover the other side of the island.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(93808,"Tribes of Europa","2074. In the wake of a mysterious global disaster, war rages between the Tribes that have emerged from the wreckage of Europe. Three siblings from the peaceful Origine tribe are separated and forced to forge their own paths in an action-packed fight for the future of this new Europa.",110.201,1,6,"/6zZxAFOtNwHCtTgSc2hU7pVIvDl.jpg",179, 7.2,"2021-02-19", "2021-02-19", "The future is not what you expected.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(94667,"Traveling with the Derbez","The series revolves around the Derbez family on their trip to Morocco, the family is made up of Eugenio Derbez, the patriarch of the family, Alessandra Rosaldo, his wife, Aitana Derbez, their daughter, Vadhir and José Eduardo Derbez, their children, and Aislinn Derbez, his eldest daughter. , along with Mauricio Ochmann and his daughter Kailani.",189.64,2,18,"/o1lAdiCYmCuDb25wyBCJQMeUhVA.jpg",1085, 7.5,"2019-10-18", "2021-06-04", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(94722,"Tagesschau","German daily news program, the oldest still existing program on German television.",1611.938,70,19925,"/7dFZJ2ZJJdcmkp05B9NWlqTJ5tq.jpg",9, 6.6,"1952-12-26", "2021-06-27", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(94924,"Trese","In Manila, where dark supernatural forces pervade the criminal underworld, it’s up to Alexandra Trese to keep the peace — but there’s a storm brewing.",241.514,1,6,"/8PdIMo0Ca6SoPjIsIEgO7FtbEor.jpg",41, 7.4,"2021-06-11", "2021-06-11", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(95057,"Superman & Lois","After years of facing megalomaniacal supervillains, monsters wreaking havoc on Metropolis, and alien invaders intent on wiping out the human race, The Man of Steel aka Clark Kent and Lois Lane come face to face with one of their greatest challenges ever: dealing with all the stress, pressures and complexities that come with being working parents in today's society.",762.221,1,15,"/vlv1gn98GqMnKHLSh0dNciqGfBl.jpg",1009, 8.3,"2021-02-23", "2021-06-22", "Saving the world starts at home.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(95479,"Jujutsu Kaisen","With his days numbered, high schooler Yuji decides to hunt down and consume the remaining 19 fingers of a deadly curse so it can die with him.",304.991,1,24,"/g1rK2nRXSidcMwNliWDIroWWGTn.jpg",1189, 8.5,"2020-10-03", "2021-03-27", "A boy fights... for "the right death."");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(95557,"Invincible","Mark Grayson is a normal teenager except for the fact that his father is the most powerful superhero on the planet. Shortly after his seventeenth birthday, Mark begins to develop powers of his own and enters into his father’s tutelage.",422.951,1,8,"/yDWJYRAwMNKbIYT8ZB33qy84uzO.jpg",2195, 8.8,"2021-03-26", "2021-04-30", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(95594,"Fast & Furious Spy Racers","A government agency recruits teen driver Tony Toretto and his thrill-seeking friends to infiltrate a criminal street racing circuit as undercover spies.",245.201,4,32,"/ejqbIUDbSWlgDeCoKBFGwbFML3N.jpg",1424, 7,"2019-12-26", "2021-04-16", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(96580,"Resident Alien","Crash-landed alien Harry takes on the identity of a small-town Colorado doctor. Arriving with a secret mission, he starts off living a simple life…but things get a bit rocky when he’s roped into solving a local murder and realizes he needs to assimilate into his new world. As he does, he begins to wrestle with the moral dilemma of his mission and asking the big life questions like: “Are human beings worth saving?” and “Why do they fold their pizza before eating it?”",142.386,1,10,"/bG5aqfT5lTHuSbcQofNHtH0RyyP.jpg",222, 8.1,"2021-01-27", "2021-03-31", "The sci-fi murder mystery doctor dramedy Earth needs now.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(96677,"Lupin","Inspired by the adventures of Arsène Lupin, gentleman thief Assane Diop sets out to avenge his father for an injustice inflicted by a wealthy family.",432.362,1,10,"/sgxawbFB5Vi5OkPWQLNfl3dvkNJ.jpg",1004, 7.9,"2021-01-08", "2021-06-11", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(97175,"Fate: The Winx Saga","The coming-of-age journey of five fairies attending Alfea, a magical boarding school in the Otherworld where they must learn to master their powers while navigating love, rivalries, and the monsters that threaten their very existence.",148.394,2,6,"/oHj6guMrLfQcBzo3uxwBJc8Y736.jpg",679, 8.5,"2021-01-22", "2021-01-22", "Channel your element. Change your fate.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(97180,"Selena: The Series","As Mexican-American Tejano singer Selena comes of age and realizes her dreams, she and her family make tough choices to hold on to love and music.",210.686,1,18,"/mYsWyfiIMxx4HDm0Wck7oJ9ckez.jpg",1395, 7.5,"2020-12-04", "2021-05-04", "Every legend begins with a dream.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(97186,"Love, Victor","Victor is a new student at Creekwood High School on his own journey of self-discovery, facing challenges at home, adjusting to a new city, and struggling with his sexual orientation. When it all seems too much, he reaches out to Simon to help him navigate the ups and downs of high school.",209.66,2,20,"/pcT1vivabBnBk0tZgVBO1I8aK75.jpg",933, 8.7,"2020-06-17", "2021-06-11", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(97513,"The Boarding School: Las Cumbres","In an inaccessible place between the mountains and isolated from the world, a school is located next to an old monastery. The students are rebellious and problematic young people who live under the strict and severe discipline imposed by the center to reintegrate them into society. The surrounding forest is home to ancient legends, threats that are still valid and that will immerse them in terrifying adventures.",173.546,1,8,"/kl07N07l4XNjXF48oujzWXs40Dw.jpg",634, 7.4,"2021-02-19", "2021-02-19", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(99617,"Halston","American fashion designer Halston skyrockets to fame before his life starts to spin out of control.",188.312,1,5,"/uBRpPFcYAYLM7V3x6x7bP3Ucumj.jpg",17, 7.4,"2021-05-14", "2021-05-14", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(100617,"Transformers: War for Cybertron: Siege","On their dying planet, the Autobots and Decepticons battle fiercely for control of the AllSpark in the Transformers universe's origin story.",128.251,1,6,"/14B6I4FxCMiDoPOwzj27EcqqY6i.jpg",190, 7.7,"2020-07-30", "2020-07-30", "");
