INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(104157,"Katla","A year after a subglacial volcano erupts, mysterious elements from prehistoric times emerge from the melting ice, bringing unforeseen consequences.",903.157,1,8,"/vRPDQP51i1Z2RuoIQaxVSj7Pd5R.jpg",24, 8,"2021-06-17", "2021-06-17", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(104877,"You Knock on My Door","Connecting all her hopes in her life to her education, Eda comes face to face with Serkan Bolat, who unknowingly cuts her scholarship abroad and caused her to remain a high school graduate. Serkan Bolat offers to give Eda her scholarship back if she pretends to be engaged to him for two months. Eda first rejects the offer due to her hatred for him, but when circumstances change, she has no choice but to accept the offer. While pretending to be engaged, Serkan and Eda begin to have a passionate, challenging relationship that will make you forget all they know right, because love is hard. And that's why it's amazing!!",282.418,1,126,"/nzBenFJ2D2MCWTwTt2uc4BGWLtA.jpg",741, 8.1,"2020-07-08", "2021-06-23", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(105009,"Tokyo Revengers","Takemichi Hanagaki is a freelancer that’s reached the absolute pits of despair in his life. He finds out that the only girlfriend he ever had, in middle school, Hinata Tachibana, had been killed by the ruthless Tokyo Manji Gang. The day after hearing about her death, he’s standing on the station platform and ends up being pushed over onto the tracks by a herd of people. He closes his eyes thinking he’s about to die, but when he opens his eyes back up, he somehow had gone back in time 12 years. Now that he’s back living the best days of his life, Takemichi decides to get revenge on his life.",305.28,1,12,"/qSEKyf0fWhrCEQ3LTwLqe41eSvR.jpg",18, 8.3,"2021-04-11", "2021-06-27", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(105971,"The Bad Batch","The 'Bad Batch' of elite and experimental clones make their way through an ever-changing galaxy in the immediate aftermath of the Clone Wars.",446.597,1,16,"/WjQmEWFrOf98nT5aEfUfVYz9N2.jpg",351, 8.6,"2021-05-04", "2021-06-25", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(106519,"Higehiro: After Being Rejected, I Shaved and Took in a High School Runaway","On his way home from drinking his sorrows away after being rejected by his crush, 26 year old salaryman Yoshida finds a high school girl named Sayu sitting on the side of the road and ends up letting her stay at his place overnight. Not having the heart to put the runaway out on the streets, Yoshida allows her to stay at his place... And so began the awkward, irritable, and slightly heartwarming relationship between a runaway high school girl and a salaryman living together.",151.54,1,13,"/aNpf4vaeZiucPqrOlIKs5Sqxzbs.jpg",9, 8.2,"2021-04-05", "2021-04-26", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(111312,"Marvel's M.O.D.O.K.","The megalomaniacal supervillain M.O.D.O.K. has long pursued his dream of one day conquering the world. But after years of setbacks and failures fighting the Earth’s mightiest heroes, M.O.D.O.K. has run his evil organization A.I.M. into the ground. Ousted as A.I.M.’s leader, while also dealing with his crumbling marriage and family life, the Mental Organism Designed Only for Killing is set to confront his greatest challenge yet: a midlife crisis!",235.846,1,10,"/2kXRzRjQZs9kAIm3K9MkQgsZR9C.jpg",19, 7.7,"2021-05-21", "2021-05-21", "World class villain. Suburban nightmare.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(112162,"Pacific Rim: The Black","Two siblings - an idealistic teenage boy and his naïve younger sister - are forced to pilot an abandoned Jaeger across a hostile landscape in a desperate attempt to find their missing parents.",320.436,1,7,"/s3mOpPwrcKCPVkSWGqEwOah4jdX.jpg",208, 8.5,"2021-03-04", "2021-03-04", "The only way home is through the Black.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(114621,"The Mighty Ducks: Game Changers","In present day Minnesota, the Mighty Ducks have evolved from scrappy underdogs to an ultra-competitive, powerhouse youth hockey team. After 12-year-old Evan is unceremoniously cut from the Ducks, he and his mom Alex set out to build their own ragtag team of misfits to challenge the cutthroat, win-at-all-costs culture of competitive youth sports.",180.194,1,10,"/625YZePh2KoSX61xVXt3JwuSq4m.jpg",75, 8.3,"2021-03-26", "2021-05-28", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(114695,"Marvel Studios: Legends","Revisit the epic heroes, villains and moments from across the MCU in preparation for the stories still to come. Each dynamic segment feeds directly into the upcoming series — setting the stage for future events. This series weaves together the many threads that constitute the unparalleled Marvel Cinematic Universe.",232.913,1,9,"/EpDuYIK81YtCUT3gH2JDpyj8Qk.jpg",439, 7.6,"2021-01-08", "2021-06-04", "As the universe expands, explore the stories of those destined to become legends.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(114868,"Record of Ragnarok","Before eradicating humankind from the world, the gods give them one last chance to prove themselves worthy of survival. Let the Ragnarok battles begin.",1187.983,1,12,"/kTs2WNZOukpWdNhoRlH94pSJ3xf.jpg",360, 8.9,"2021-06-17", "2021-06-17", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(115004,"Mare of Easttown","A detective in a small Pennsylvania town investigates a local murder while trying to keep her life from falling apart.",253.873,1,7,"/78aK4Msbr22A5PGa6PZV0pAvdwf.jpg",300, 8.1,"2021-04-18", "2021-05-30", "All truths come to light.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(116386,"Doom at Your Service","Dong-kyung has been working hard ever since her parents passed away. Her life seems to get stable after working as an web novel editor for 6 years, but one day she gets diagnosed with a brain cancer. She blames her unlucky life and wishes to curse everything to disappear, which unintentionally calls Myul Mang, a messenger between humans and gods, to appear. He says that he can grant her wishes. As her last hope, she makes a contract with Myul Mang for hundred days to live as how she wants, risking her everything.",217.452,1,16,"/o1aus1uSJH0S4FDUlBRCSfKEKuW.jpg",19, 9.3,"2021-05-10", "2021-06-22", "Pray for doom, love has come into life.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(117023,"Sky Rojo","On the run from their pimp and his henchmen, three women embark on a wild and crazy journey in search of freedom.",187.616,2,16,"/uTFX9V2dct1nKjG6zhNiThPm8Tp.jpg",185, 7.8,"2021-03-19", "2021-03-19", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(117581,"Ginny & Georgia","Angsty and awkward fifteen year old Ginny Miller often feels more mature than her thirty year old mother, the irresistible and dynamic Georgia Miller. After years on the run, Georgia desperately wants to put down roots in picturesque New England and give her family something they've never had... a normal life. But it's not all carpool and Kombucha as Georgia's past threatens her and her family's new way of life... and Georgia will do anything to protect her family.",166.512,1,10,"/e4aqizYQ8eeTGNZMq6WiFfqoZbz.jpg",492, 8.1,"2021-02-24", "2021-02-24", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(118588,"I Became a Kuro-Gyaru so I F***ed My Best Friend.","Shion and Rui are the dream team when it comes to hitting on women. Tonight was going to be another night of hooking up with girls for Shion, but he ended up taking a strange drug. When he woke up... he'd turned into a girl?! Rui came looking for Shion, but didn't recognize him, and started hitting on him...",176.38,1,8,"/faFXOj5nfVwn12vq0eUqkD42Cas.jpg",3, 9,"2021-04-05", "2021-05-24", "");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(118956,"DOTA: Dragon's Blood","After encounters with a dragon and a princess on her own mission, a Dragon Knight becomes embroiled in events larger than he could have ever imagined.",172.363,1,8,"/s1wP1YeQS9fgSHiXZ3yJb2ufB2D.jpg",109, 8.2,"2021-03-25", "2021-03-25", "Against all odds, heroes will rise.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(119243,"iCarly","Ten years after signing off of one of TV's most iconic shows, Carly, Spencer, and Freddie are back, navigating the next chapter of their lives, facing the uncertainties of life in their twenties.",1932.403,1,5,"/s5k4GqTUGXeUdScNrjpYfiQLKHI.jpg",211, 8,"2021-06-17", "2021-06-24", "Leave it all to me...");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(119988,"The Innocent","An accidental killing leads a man down a dark hole of intrigue and murder. Just as he finds love and freedom, one phone call brings back the nightmare.",186.065,1,8,"/6USbtATMqFLkeafx3FV3wcGZTNo.jpg",15, 8.8,"2021-04-30", "2021-04-30", "Nobody escapes from the past.");
INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(120168,"Who Killed Sara?","Hell-bent on exacting revenge and proving he was framed for his sister's murder, Álex sets out to unearth much more than the crime's real culprit.",367.102,2,18,"/o7uk5ChRt3quPIv8PcvPfzyXdMw.jpg",840, 7.7,"2021-03-24", "2021-05-19", "");
